import React from "react";

//css
import "../Css/Project.css";

function Project() {
	return (
		<div className="project">
			<h1>Project</h1>

			<Sorayama></Sorayama>
		</div>
	);
}

function Sorayama() {
	return (
		<div className="sorayama-wrap">
			<h3>JUUN.J X SORAYAMA HAJIME (2016.01)</h3>
		</div>
	);
}

export default Project;
